import { Button, DataTable } from 'carbon-components-react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <Button>CarbonButton</Button>
      <DataTable></DataTable>
    </div>
  );
}

export default App;
